// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./RentalAgreement.sol";

contract CommissionContract {
    RentalAgreement public rentalAgreement;

    // Commission rate in basis points (1 basis point = 0.01%)
    uint256 public commissionRate; // e.g., 1000 represents 10%

    event CommissionTransferred(uint256 indexed agreementId, address indexed tenant, address indexed stateAgent, uint256 commissionAmount);

    constructor(address _rentalAgreement, uint256 _commissionRate) {
        rentalAgreement = RentalAgreement(_rentalAgreement);
        commissionRate = _commissionRate;
    }

    function transferCommission(uint256 _agreementId,address _tenant,address _stateAgent,address _landlord) external {
        // Retrieve the agreement details from RentalAgreement contract
        (
            address landlord,
            address tenant,
            address stateAgent,
            
            ,
            uint256 rentAmount,
            ,
            ,
            RentalAgreement.AgreementStatus status,
            ,
        ) = rentalAgreement.agreements(_agreementId);

        // Check if the agreement is active
        require(status == RentalAgreement.AgreementStatus.Active, "Agreement must be active");

        // Check if the state agent matches
        require(_stateAgent == stateAgent, "StateAgent must match");
        require(_tenant == tenant, "Tenant must match");
        require(_landlord == landlord, "Tenant must match");


        // Calculate commission based on the commission rate
        uint256 commissionAmount = (rentAmount * commissionRate) / 10000; // Division by 10000 to convert basis points to percentage

        // Transfer commission from tenant to state agent
        // Use a more secure payment mechanism in a real-world scenario
        // e.g., implement a withdrawal pattern with proper error handling
        payable(stateAgent).transfer(commissionAmount);

        // Emit an event for tracking the commission transfer
        emit CommissionTransferred(_agreementId, tenant, stateAgent, commissionAmount);
    }
}

