// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./RegistrationContract.sol";


contract PropertyListing {
    RegistrationContract public registrationContract;

    enum PropertyStatus { Pending, Listed, Rented ,Delisted}

    struct Property {
        string propertyAddress;
        string city;
        string area;
        uint8 floorsToRent;
        address ownerWallet;
        address stateAgent;
        PropertyStatus status;
        bool delistApproved; // New variable to track delisting approval
    }

    mapping(string => bool) public uniquePropertyAddresses; // New mapping for checking uniqueness of property addresses
    mapping(uint256 => Property) public properties;
    uint256 public propertyCount;

    event PropertyListed(uint256 indexed propertyId, string propertyAddress, string city, string area, uint8 floorsToRent, address ownerWallet, address stateAgent);
    event PropertyStatusChanged(uint256 indexed propertyId, PropertyStatus newStatus);

    constructor(address _registrationContract) {
        registrationContract = RegistrationContract(_registrationContract);
    }

    function listProperty(
        string memory _propertyAddress,
        string memory _city,
        string memory _area,
        uint8 _floorsToRent,
        address _ownerWallet
    ) external {
        (, , RegistrationContract.UserRole role, ) = registrationContract.users(msg.sender);

        require(role == RegistrationContract.UserRole.StateAgent, "Only StateAgent can list properties");
        require(!uniquePropertyAddresses[_propertyAddress], "Property with this address is already listed");

        // Check if the owner is registered
        (, , RegistrationContract.UserRole ownerRole, ) = registrationContract.users(_ownerWallet);
        require(ownerRole == RegistrationContract.UserRole.Landlord, "Owner must be a registered Landlord");

        uint256 propertyId = propertyCount++;
        properties[propertyId] = Property({
            propertyAddress: _propertyAddress,
            city: _city,
            area: _area,
            floorsToRent: _floorsToRent,
            ownerWallet: _ownerWallet,
            stateAgent: msg.sender,
            status: PropertyStatus.Pending,
            delistApproved: false // Initialize delist approval to false
        });

        uniquePropertyAddresses[_propertyAddress] = true;

        emit PropertyListed(propertyId, _propertyAddress, _city, _area, _floorsToRent, _ownerWallet, msg.sender);
    }

    function approveStatusToListing(uint256 _propertyId) external {
        require(properties[_propertyId].ownerWallet == msg.sender, "Only the property owner can approve the property listing");
        require(properties[_propertyId].status == PropertyStatus.Pending || properties[_propertyId].status == PropertyStatus.Delisted , "Property must be in Pending or Delisted status to be approved");

        properties[_propertyId].status = PropertyStatus.Listed;

        emit PropertyStatusChanged(_propertyId, PropertyStatus.Listed);
    }

    function getStateAgentForProperty(uint256 _propertyId) external view returns (address) {
        return properties[_propertyId].stateAgent;
    }

    function markPropertyAsRented(uint256 _propertyId) external {
       
        require(properties[_propertyId].status == PropertyStatus.Listed, "Property must be listed before marking as rented");

        properties[_propertyId].status = PropertyStatus.Rented;

        emit PropertyStatusChanged(_propertyId, PropertyStatus.Rented);
    }

    function approveDelisting(uint256 _propertyId) external {
        require(properties[_propertyId].ownerWallet == msg.sender, "Only the property owner can approve delisting");
        require(properties[_propertyId].status == PropertyStatus.Pending || properties[_propertyId].status == PropertyStatus.Delisted, "Property must be in Pending or Delisted status to be approved for delisting");

        properties[_propertyId].delistApproved = true;

        // You can emit an event here if needed
    }

    function delistProperty(uint256 _propertyId) external {
        require(properties[_propertyId].stateAgent == msg.sender, "Only the StateAgent can delist the property");
        require(properties[_propertyId].status != PropertyStatus.Rented, "Cannot delist a rented property");
        require(properties[_propertyId].delistApproved, "Delisting must be approved by the owner");

        properties[_propertyId].status = PropertyStatus.Delisted;

        emit PropertyStatusChanged(_propertyId, PropertyStatus.Delisted);
    }
}

contracts/RegistrationContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RegistrationContract {
    enum UserRole {
        StateAgent,
        Tenant,
        Landlord
    }

    struct User {
        string name;
        string cnic;
        UserRole role;
        string estateName; // Additional field for state agents
    }

    mapping(string => address) public cnicToAddress; // New mapping for CNIC to address
    mapping(address => User) public users;

    event UserRegistered(
        address indexed userAddress,
        string name,
        string cnic,
        UserRole role,
        string estateName
    );

    function registerUser(
        string memory _name,
        string memory _cnic,
        UserRole _role,
        string memory _estateName
    ) external {
        require(bytes(_name).length > 0, "Name cannot be empty");
        require(bytes(_cnic).length > 0, "CNIC cannot be empty");
        require(
            bytes(users[msg.sender].name).length == 0,
            "User already registered"
        );
        require(cnicToAddress[_cnic] == address(0), "CNIC already registered");

        if (_role == UserRole.StateAgent) {
            require(
                bytes(_estateName).length > 0,
                "Estate name is required for State Agents"
            );
        }

        users[msg.sender] = User({
            name: _name,
            cnic: _cnic,
            role: _role,
            estateName: _estateName
        });

        cnicToAddress[_cnic] = msg.sender;

        emit UserRegistered(msg.sender, _name, _cnic, _role, _estateName);
    }

    function getUserDetailsByCNIC(
        string memory _cnic
    ) external view returns (string memory, UserRole, string memory) {
        address userAddress = cnicToAddress[_cnic];
        require(
            userAddress != address(0),
            "User not found with the given CNIC"
        );

        User memory user = users[userAddress];
        return (user.name, user.role, user.estateName);
    }
}

