// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./PropertyListing.sol";

contract RentalAgreement {
    enum AgreementStatus { Pending, LandlordApproved, TenantApproved, Active, Inactive, Canceled }

    struct Agreement {
        address landlord;
        address tenant;
        address stateAgent;
        uint256 propertyId;
        uint256 rentAmount;
        uint256 durationMonths;
        uint256 startTime;
        AgreementStatus status;
        bool landlordApprovalForCancellation;
        bool tenantApprovalForCancellation;
    }

    PropertyListing public propertyListing;

    mapping(uint256 => Agreement) public agreements;
    mapping(uint256 => mapping(address => bool)) public existingAgreement; // To check if an agreement already exists for the given property, landlord, and tenant
    uint256 public agreementCount;

    event AgreementCreated(uint256 indexed agreementId, address landlord, address tenant, uint256 propertyId, uint256 rentAmount, uint256 durationMonths, address stateAgent);
    event AgreementApproved(uint256 indexed agreementId, address approver, AgreementStatus newStatus);
    event AgreementActivated(uint256 indexed agreementId, uint256 startTime);
    event AgreementCanceled(uint256 indexed agreementId);

    constructor(address _propertyListing) {
        propertyListing = PropertyListing(_propertyListing);
    }

    function createAgreement(
        uint256 _propertyId,
        uint256 _rentAmount,
        uint256 _durationMonths,
        address _landlord,
        address _tenant
    ) external {

        require(!existingAgreement[_propertyId][_tenant] && !existingAgreement[_propertyId][_landlord] , "An agreement with the same property, landlord, and tenant already exists");
        require(msg.sender == propertyListing.getStateAgentForProperty(_propertyId), "Only StateAgent can create agreements");

        (
            , // Ignored propertyAddress
            , // Ignored city
            , // Ignored area
            , // Ignored floorsToRent
            address ownerWallet,
            address stateAgent,
            ,
        ) = propertyListing.properties(_propertyId);

        uint256 agreementId = agreementCount++;
        existingAgreement[_propertyId][_tenant] = true;

        agreements[agreementId] = Agreement({
            landlord: ownerWallet,
            tenant: _tenant,
            stateAgent: stateAgent,
            propertyId: _propertyId,
            rentAmount: _rentAmount,
            durationMonths: _durationMonths,
            startTime: 0,
            status: AgreementStatus.Pending,
            landlordApprovalForCancellation: false,
            tenantApprovalForCancellation: false
        });

        emit AgreementCreated(agreementId, ownerWallet, _tenant, _propertyId, _rentAmount, _durationMonths, stateAgent);
    }

    function landlordApproveAgreement(uint256 _agreementId) external {
        require(msg.sender == agreements[_agreementId].landlord, "Only landlord can approve the agreement");
        require(agreements[_agreementId].status == AgreementStatus.Pending, "Agreement must be pending");

        agreements[_agreementId].status = AgreementStatus.LandlordApproved;

        emit AgreementApproved(_agreementId, msg.sender, AgreementStatus.LandlordApproved);
    }

    function tenantApproveAgreement(uint256 _agreementId) external {
        require(msg.sender == agreements[_agreementId].tenant, "Only tenant can approve the agreement");
        require(agreements[_agreementId].status == AgreementStatus.LandlordApproved, "Landlord must approve before tenant");

        agreements[_agreementId].status = AgreementStatus.TenantApproved;
        emit AgreementApproved(_agreementId, msg.sender, AgreementStatus.TenantApproved);
    }

    function activateAgreement(uint256 _agreementId) external {
        require(agreements[_agreementId].status == AgreementStatus.TenantApproved, "Tenant must approve before activation");
        require(msg.sender == agreements[_agreementId].stateAgent, "Only StateAgent can activate agreement");

        agreements[_agreementId].status = AgreementStatus.Active;
        agreements[_agreementId].startTime = block.timestamp;

        // Mark the property as rented when the agreement is activated
        propertyListing.markPropertyAsRented(agreements[_agreementId].propertyId);

        emit AgreementActivated(_agreementId, block.timestamp);
    }

    function cancelAgreement(uint256 _agreementId) external {
        require(msg.sender == agreements[_agreementId].landlord || msg.sender == agreements[_agreementId].tenant, "Only landlord or tenant can cancel agreement");

        if (agreements[_agreementId].status == AgreementStatus.Active) {
            // Check if the duration has been completed
            require(block.timestamp >= agreements[_agreementId].startTime + agreements[_agreementId].durationMonths * 30 days, "Duration not completed");
        }

        // Mark the property as listed when the agreement is canceled
        propertyListing.delistProperty(agreements[_agreementId].propertyId);
        agreements[_agreementId].status = AgreementStatus.Canceled;

        emit AgreementCanceled(_agreementId);
    }

    function approveCancellation(uint256 _agreementId) external {
        require(msg.sender == agreements[_agreementId].landlord || msg.sender == agreements[_agreementId].tenant, "Only landlord or tenant can approve cancellation");

        if (msg.sender == agreements[_agreementId].landlord) {
            agreements[_agreementId].landlordApprovalForCancellation = true;
        } else {
            agreements[_agreementId].tenantApprovalForCancellation = true;
        }

        // Check if both landlord and tenant have approved cancellation
        if (agreements[_agreementId].landlordApprovalForCancellation && agreements[_agreementId].tenantApprovalForCancellation) {
            // Mark the property as listed when the agreement is canceled
            propertyListing.delistProperty(agreements[_agreementId].propertyId);
            agreements[_agreementId].status = AgreementStatus.Canceled;

            emit AgreementCanceled(_agreementId);
        }
    }
}

